import React, { Component } from "react";
// import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import './css/style.css'

class Header extends Component {
  render() {
    return (

      <header class="header header-animated">
    <div class="container">
        <nav class="navbar navbar-default" role="navigation">
            <div class="navbar-header">
            <a class="logo" href="/">
                    <img class="img-responsive logo" src="https://images.contentstack.io/v3/assets/blt2f8208e2d15beeb0/blt5d6e0efe5c5d2936/58f0a80478ac9beb071a07f0/download" alt="" data-logo-alt="https://images.contentstack.io/v3/assets/blt2f8208e2d15beeb0/blt5d6e0efe5c5d2936/58f0a80478ac9beb071a07f0/download" data-logo-default="https://images.contentstack.io/v3/assets/blt2f8208e2d15beeb0/bltca8978c28f812283/58f0a8062cad9d980736e1d5/download"/>
                </a>
            </div>
            <div class="nav-toggle collapsed" data-toggle="collapse" data-target="#navbarMain" aria-expanded="false">
                <span></span>
                <span></span>
                <span></span>
                <span></span>
                <span></span>
                <span></span>
            </div>
            {/* <!-- Collect the nav links, forms, and other content for toggling --> */}
            <div class="collapse navbar-collapse" id="navbarMain">
                <ul class="nav navbar-nav navbar-right">
                    <li>
                        <a href="" class="btn btn-primary-outline" data-toggle="modal" data-target="#signUp">SignUp</a>
                    </li>
                    <li>
                        <a href="" data-toggle="modal" data-target="#login">Login</a>
                    </li>
                </ul>
                <ul class="nav navbar-nav collapsed-color">
                    {/* {%for menu in header.navigation_section.navigation_bar %} {%if menu.sub_navigation.length > 0%} */}
                    <li class="dropdown">
                        <a class="dropdown-toggle" href="{{menu.link}}">Blog<i class="fa fa-angle-down"></i></a>
                        <ul class="dropdown-menu animated fadeInUp" role="menu">
                            {/* {% for sub in menu.sub_navigation %} */}
                            <li>
                                <a href="{{sub.link}}">Hello</a>
                            </li>
                            {/* {% endfor %} */}
                        </ul>
                    </li>
                    {/* {% else %} */}
                    <li>
                        <a href="{{menu.link}}" class="scroll">Blog</a>
                    </li>
                    {/* // {% endif %} {% endfor %} */}
                </ul>
            </div>
            {/* // <!-- .navbar-collapse --> */}
        </nav>
    </div>
</header>

    );
  }
}

export default Header;
